 opiniones ajenas. ¡Sigue trabajando y no dudes en pedir ayuda si la necesitas!  Ánimo, puedes hacerlo!\"},{\"from\":51,\"to\":100,\"feedback\":\"Has hecho un trabajo excepcional en esta actividad, mostrando tanto habilidades cognitivas como emocionales en la construcción de tu argumento.  ¡Sigue así! Estás en el camino correcto ¡Felicidades por tu excelente trabajo!\"}],\"behaviour\":{\"scoringMode\":\"positions\",\"applyPenalties\":true,\"duplicatesInterchangeable\":true,\"addButtonsForMovement\":true,\"enableRetry\":true,\"enableSolutionsButton\":true},\"l10n\":{\"checkAnswer\":\"Comprobar\",\"submitAnswer\":\"Enviar\",\"tryAgain\":\"Intentar de nuevo\",\"showSolution\":\"Mostrar solución\",\"up\":\"Arriba\",\"down\":\"Abajo\",\"disabled\":\"Deshabilitado\"},\"a11y\":{\"check\":\"Comprobar las respuestas. Las respuestas se marcarán como correcta o incorrecta.\",\"showSolution\":\"Mostrar la solución. Se mostrará la solución correcta.\",\"retry\":\"Vuelve a intentar la tarea. Borra todas tus respuestas y empieza de nuevo.\",\"yourResult\":\"Has obtenido @score de un total de @total puntos\",\"listDescription\":\"Lista ordenable de párrafos.\",\"listDescriptionCheckAnswer\":\"Lista de párrafos con resultados.\",\"listDescriptionShowSolution\":\"Lista de párrafos con soluciones.\",\"paragraph\":\"Párrafo\",\"correct\":\"correcto\",\"wrong\":\"incorrecto\",\"point\":\"@score punto\",\"sevenOfNine\":\"@current de @total\",\"currentPosition\":\"Posición actual en lista\",\"instructionsSelected\":\"Presiona la barra espaciadora para reordenar\",\"instructionsGrabbed\":\"Presiona las teclas de dirección arriba y abajo para cambiar la posición, barra espaciadora para soltar, escape para cancelar\",\"grabbed\":\"Cogido\",\"moved\":\"Movido\",\"dropped\":\"Soltado\",\"reorderCancelled\":\"Reordenación cancelada\",\"finalPosition\":\"Posición final\",\"nextParagraph\":\"Párrafo siguiente\",\"correctParagraph\":\"Párrafo correcto en la posición\"},\"taskDescription\":\"<p>Esta actividad tiene como objetivo principal enseñar a los estudiantes cómo estructurar un texto argumentativo sólido, organizado de manera lógica y coherente, y cómo integrar el respeto por las opiniones ajenas durante la construcción de sus argumentos.</p>\\n\\n<p>Los estudiantes recibirán un conjunto de párrafos desordenados que cubren los temas de <strong>cómo construir una opinión basada en argumentos</strong> y el <strong>respeto por opiniones distintas</strong>. El desafío será <strong>ordenar los párrafos</strong> de acuerdo con la estructura lógica de un texto argumentativo.</p>\\n\\n<p> </p>\\n\",\"paragraphs\":[\"<ul>\\n\\t<li style=\\\"margin-top:16px; margin-bottom:16px; margin-left:8px\\\">\\n\\t<p data-end=\\\"2149\\\" data-start=\\\"1760\\\"><strong data-end=\\\"1820\\\" data-start=\\\"1760\\\">Elegir un Tema y Definir los Límites</strong><br data-end=\\\"1823\\\" data-start=\\\"1820\\\">\\n\\t<em data-end=\\\"2149\\\" data-start=\\\"1823\\\">\\\"Para empezar, es fundamental seleccionar un tema que sea de interés y que permita explorar diferentes ángulos. Al definir los límites del tema, se asegura que el análisis se enfoque en aspectos relevantes, evitando que se convierta en algo demasiado amplio o ambiguo. Esta claridad es clave para formular una tesis sólida.\\\"</em></p>\\n\\t</li>\\n</ul>\\n\",\"<ul>\\n\\t<li style=\\\"margin-top:16px; margin-bottom:16px; margin-left:8px\\\">\\n\\t<p data-end=\\\"2514\\\" data-start=\\\"2156\\\"><strong data-end=\\\"2198\\\" data-start=\\\"2156\\\">Formular una Tesis</strong><br data-end=\\\"2201\\\" data-start=\\\"2198\\\">\\n\\t<em data-end=\\\"2514\\\" data-start=\\\"2201\\\">\\\"La tesis es una afirmación clara y concisa que se defenderá durante todo el texto. Esta afirmación debe ser lo suficientemente específica para dirigir el debate y permitir la presentación de argumentos sólidos. La tesis debe estar alineada con el tema elegido y ser capaz de generar una discusión interesante.\\\"</em></p>\\n\\t</li>\\n</ul>\\n\",\"<ul>\\n\\t<li style=\\\"margin-top:16px; margin-bottom:16px; margin-left:8px\\\">\\n\\t<p data-end=\\\"2905\\\" data-start=\\\"2521\\\"><strong data-end=\\\"2579\\\" data-start=\\\"2521\\\">Investigar y Recopilar Información</strong><br data-end=\\\"2582\\\" data-start=\\\"2579\\\">\\n\\t<em data-end=\\\"2905\\\" data-start=\\\"2582\\\">\\\"Una vez definida la tesis, es esencial recopilar información y evidencias que respalden la postura que se va a defender. Esto puede incluir estadísticas, ejemplos de casos reales, investigaciones académicas o incluso testimonios de expertos. La investigación sólida fortalece la argumentación y la hace más convincente.\\\"</em></p>\\n\\t</li>\\n</ul>\\n\",\"<ul>\\n\\t<li style=\\\"margin-top:16px; margin-bottom:16px; margin-left:8px\\\"><strong data-end=\\\"2962\\\" data-start=\\\"2912\\\">Estructurar los Argumentos</strong><br data-end=\\\"2965\\\" data-start=\\\"2962\\\">\\n\\t<em data-end=\\\"3269\\\" data-start=\\\"2965\\\">\\\"Es importante organizar los argumentos de manera lógica y coherente. Cada argumento debe estar acompañado de evidencias claras que lo respalden. Además, se debe presentar cada argumento de manera que fluya naturalmente hacia el siguiente, permitiendo que el lector siga el razonamiento con facilidad.\\\"</em></li>\\n</ul>\\n\",\"<ul>\\n\\t<li style=\\\"margin-top:16px; margin-bottom:16px; margin-left:8px\\\"><strong data-end=\\\"3339\\\" data-start=\\\"3276\\\">Presentar los Argumentos de Forma Clara</strong><br data-end=\\\"3342\\\" data-start=\\\"3339\\\">\\n\\t<em data-end=\\\"3632\\\" data-start=\\\"3342\\\">\\\"Para que los argumentos sean efectivos, deben expresarse de manera clara y persuasiva. Utilizar un lenguaje apropiado y enfocar cada argumento en el público objetivo ayudará a que la tesis sea comprendida y aceptada. Es crucial presentar los argumentos con confianza y sin ambigüedades.\\\"</em></li>\\n</ul>\\n\",\"<ul>\\n\\t<li style=\\\"margin-top:16px; margin-bottom:16px; margin-left:8px\\\"><strong data-end=\\\"3698\\\" data-start=\\\"3639\\\">Reforzar la Tesis con la Conclusión</strong><br data-end=\\\"3701\\\" data-start=\\\"3698\\\">\\n\\t<em data-end=\\\"3978\\\" data-start=\\\"3701\\\">\\\"La conclusión debe resumir los argumentos principales y reafirmar la tesis defendida. Es importante que la conclusión deje una impresión clara y convincente, sin introducir nuevos argumentos, sino destacando por qué la tesis es válida a la luz de la información presentada.\\\"</em></li>\\n</ul>\\n\",\"<ul>\\n\\t<li style=\\\"margin-bottom:11px\\\">Respeto por Opiniones Distintas)</li>\\n</ul>\\n\\n<p style=\\\"margin-left:47px; margin-bottom:11px\\\"><em data-end=\\\"4350\\\" data-start=\\\"4035\\\">\\\"Durante el proceso de construcción de argumentos, es esencial escuchar activamente a aquellos con opiniones diferentes. Preguntar de manera abierta, reconocer las diferencias y buscar puntos en común ayuda a mantener un ambiente de respeto y entendimiento mutuo, lo cual es vital para el diálogo y la reflexión.\\\"</em></p>\\n\",\"<ul>\\n\\t<li style=\\\"margin-bottom:11px\\\"><strong>Conclusión sobre el Respeto a Opiniones Distintas</strong></li>\\n</ul>\\n\\n<p style=\\\"margin-left:47px; margin-bottom:11px\\\">&nbsp;\\\"El respeto por las opiniones ajenas es un componente fundamental de cualquier discusión constructiva. Al escuchar activamente y ser empáticos, no solo aprendemos de los demás, sino que también demostramos que estamos abiertos a la reflexión y el crecimiento personal.\\\"</p>\\n\",\"<ul>\\n\\t<li style=\\\"margin-bottom:11px\\\"><strong>Empatía y Consideración de la Perspectiva Ajena</strong></li>\\n</ul>\\n\\n<p style=\\\"margin-left:47px; margin-bottom:11px\\\"><em data-end=\\\"4732\\\" data-start=\\\"4423\\\">\\\"Es fundamental ser respetuoso y empático con quienes tienen puntos de vista contrarios. No se trata solo de defender una postura, sino de reconocer que cada persona tiene sus propios motivos para pensar de determinada manera. Esto genera un ambiente de respeto que permite el intercambio genuino de ideas.\\\"</em></p>\\n\"]}","library":"H5P.SortParagraphs 0.11","contentUrl":".","metadata":{"license":"U","title":"Actividad sobre construcción de opinión y respeto por opiniones distintas","defaultLanguage":"en"},"scripts":["/h5p/libraries/H5P.Image-1.1/image.js?version=1.1.22","/h5p/libraries/H5P.Transition-1.0/transition.js?version=1.0.4","/h5p/libraries/H5P.JoubelUI-1.3/js/joubel-help-dialog.js?version=1.3.19","/h5p/libraries/H5P.JoubelUI-1.3/js/joubel-message-dialog.js?version=1.3.19","/h5p/libraries/H5P.JoubelUI-1.3/js/joubel-progress-circle.js?version=1.3.19","/h5p/libraries/H5P.JoubelUI-1.3/js/joubel-simple-rounded-button.js?version=1.3.19","/h5p/libraries/H5P.JoubelUI-1.3/js/joubel-speech-bubble.js?version=1.3.19","/h5p/libraries/H5P.JoubelUI-1.3/js/joubel-throbber.js?version=1.3.19","/h5p/libraries/H5P.JoubelUI-1.3/js/joubel-tip.js?version=1.3.19","/h5p/libraries/H5P.JoubelUI-1.3/js/joubel-slider.js?version=1.3.19","/h5p/libraries/H5P.JoubelUI-1.3/js/joubel-score-bar.js?version=1.3.19","/h5p/libraries/H5P.JoubelUI-1.3/js/joubel-progressbar.js?version=1.3.19","/h5p/libraries/H5P.JoubelUI-1.3/js/joubel-ui.js?version=1.3.19","/h5p/libraries/H5P.Question-1.5/scripts/question.js?version=1.5.15","/h5p/libraries/H5P.Question-1.5/scripts/explainer.js?version=1.5.15","/h5p/libraries/H5P.Question-1.5/scripts/score-points.js?version=1.5.15","/h5p/libraries/H5P.SortParagraphs-0.11/dist/h5p-sort-paragraphs.js?version=0.11.9"],"styles":["/h5p/libraries/H5P.Image-1.1/image.css?version=1.1.22","/h5p/libraries/FontAwesome-4.5/h5p-font-awesome.min.css?version=4.5.4","/h5p/libraries/H5P.FontIcons-1.0/styles/h5p-font-icons.css?version=1.0.6","/h5p/libraries/H5P.JoubelUI-1.3/css/joubel-help-dialog.css?version=1.3.19","/h5p/libraries/H5P.JoubelUI-1.3/css/joubel-message-dialog.css?version=1.3.19","/h5p/libraries/H5P.JoubelUI-1.3/css/joubel-progress-circle.css?version=1.3.19","/h5p/libraries/H5P.Joube
